<div class="entities" style="line-height: 2.5; direction: ltr">Regulation of Q9BYW2 { alpha } activity in adipose tissue by obesity-associated factors : adipogenesis , insulin , and hypoxia . The transcription factor HIF - 1α activity is increased in adipose tissue to contribute to chronic inflammation in obesity . However , its upstream and downstream events remain to be characterized in adipose tissue in obesity . We addressed this issue by investigating adipocyte HIF - 1α activity in response to obesity-associated factors , such as adipogenesis , insulin , and hypoxia . In adipose tissue , both HIF - 1α mRNA and protein were increased by obesity . The underlying mechanism was investigated in 3T3 - Q9NUQ9 adipocytes . HIF - 1α mRNA and protein were augmented by adipocyte differentiation . In differentiated adipocytes , insulin further enhanced HIF - 1α in both levels . Hypoxia enhanced only HIF - 1α protein , not mRNA . PI3K and

<div class="entities" style="line-height: 2.5; direction: ltr">Signalling pathways involved in retinal endothelial cell proliferation induced by advanced glycation end products : inhibitory effect of gliclazide . AIM : We have previously demonstrated that advanced glycation end products ( AGEs ) stimulate bovine retinal endothelial cell ( BREC ) proliferation through induction of vascular endothelial growth factor (

 expression were assessed by Western blot analysis using specific antibodies . MAPK activity was also determined by an in vitro kinase assay . RESULTS : Treatment of BRECs with AGEs significantly increased cell proliferation and

 effects on cell proliferation and

<div class="entities" style="line-height: 2.5; direction: ltr">Management of ocular inflammation and pain following cataract surgery : focus on bromfenac ophthalmic solution . Recently , several new ophthalmic NSAID products have been introduced for commercial use in the United States . The purpose of this review is to briefly overview the ophthalmic NSAIDs currently in use and to discuss the management of postoperative ocular inflammation and pain following cataract surgery with a particular focus on bromfenac ophthalmic solution 0.09 % . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ophthalmic solution 0.09 % is indicated for the reduction of ocular pain and inflammation following cataract surgery . Studies have shown that bromfenac ophthalmic solution 0.09 % has equivalent efficacy to the other topical NSAIDs in reducing postsurgical inflammation and controlling pain . The unique chemical structure of bromfenac makes it both a potent inhibitor of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354

</mark>
 enzyme and a highly lipophilic molecule that rapidly penetrates to produce early and sustained drug levels in all ocular tissues . Clinically , these pharmacokinetic features are manifested in a rapid reduction of postsurgical inflammation and pain with bid dosing . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ophthalmic solution 0.09 % is a versatile agent and is effective when used as either monotherapy or as an adjunct therapy to steroids .</div>

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The v-ErbA oncoprotein quenches the activity of an erythroid-specific enhancer . v-ErbA is a mutated variant of thyroid hormone receptor ( TRalpha / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) borne by the Avian Erythroblastosis virus causing erythroleukemia . TRalpha is known to activate transcription of specific genes in the presence of its cognate ligand , 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 hormone , while in its absence it represses it . v-ErbA is unable to bind ligand , and hence is thought to contribute to leukemogenesis by actively repressing erythroid-specific genes such as the carbonic anhydrase II gene ( CA II ) . In the prevailing model , v-ErbA occludes liganded TR from binding to its cognate elements and constitutively interacts with the corepressors NCoR / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . We previously identified a v-ErbA responsive element ( VRE ) within a P24855 hypersensitive region ( Q5VYS8 ) located in the second intron of the CA II gene . We now show that Q5VYS8 fulfils all the requirements for a genuine enhancer that functions independent of its orientation and position with a profound erythroid-specific activity in normal erythroid progenitors ( T2ECs ) and in leukemic erythroid cell lines . We find that the Q5VYS8 enhancer activity is governed by two adjacent GATA-factor binding sites . v-ErbA as well as unliganded TR prevent Q5VYS8 activity by nullifying the positive function of factors bound to GATA-sites . However , v-ErbA , in contrast to TR , does not convey active repression to silence the transcriptional activity intrinsic to a heterologous tk promoter . We propose that depending on the sequence and context of the binding site , v-ErbA contributes to leukemogenesis by occluding liganded TR as well as unliganded TR thereby preventing activation or repression , respectively .</div>
